import React from 'react'

import classes from './MuqButton.module.css'

const MuqButton = (props) => {
  return (
    <button className={`${classes.button} ${props.className}`}>
      <span className={classes.span1}>{props.name}</span>
    </button>
  )
}

export default MuqButton
